    data: |
      SELECT ALL col2 - cor0.col2 AS col0 FROM tab1 (FORMAT parquet) cor0 WHERE NOT ( + col1 ) <= NULL OR NULL NOT BETWEEN col1 AND col0 / col1;
  - name: tab1

outputs:
  - name: q9286.out
    data: |
